import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  if (!token) return null; // Don't show if not logged in

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  const navStyle = {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '0 2rem',
    height: '70px',
    backgroundColor: 'white',
    boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
    position: 'sticky',
    top: 0,
    zIndex: 1100
  };

  const linkStyle = {
    textDecoration: 'none',
    color: '#333',
    fontWeight: '600',
    marginLeft: '20px',
    cursor: 'pointer'
  };

  return (
    <nav style={navStyle}>
      <Link to="/" style={{...linkStyle, fontSize:'1.5rem', color:'#b8369a', marginLeft:0}}>SheSecure</Link>
      <div>
        <Link to="/dashboard" style={linkStyle}>Dashboard</Link>
        <Link to="/community-map" style={linkStyle}>Community Map</Link>
        <Link to="/contacts" style={linkStyle}>Contacts</Link>
        <button onClick={handleLogout} style={{marginLeft:'20px', padding:'8px 15px', background:'#dc3545', color:'white', border:'none', borderRadius:'5px', cursor:'pointer', fontWeight:'bold'}}>
          Logout
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
